import React from 'react'
import { Text, View, StyleSheet } from 'react-native'

const WishScreen = () => {
    return (
        <View>
            <Text>All The Best !</Text>
            <Image 
                source={require('../../assets/logo.png')}
            />
        </View>
    )
}

export default WishScreen
